export function Breadcrumb({ categories }) {
  return (
    <div className="breadcrumbConteiner">
    <ol className="breadcrumb">
      {categories.map((category, i) => {
        return (
          <li className="breadcrumbItem" key={i}>
            {` ${category}`}
          </li>
        );
      })}
    </ol>
    </div>
  );
}
